"use strict";function randomInt(t,n){return Math.floor(Math.random()*(n-t+1))+t}function generateToken(t){let n="abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ1234567890",r="";for(let e=0;e<t;e++)r+=n[randomInt(0,n.length-1)];return r}function formatTime(){let t="",n=new Date,r=n.getHours(),e=n.getMinutes();return e<10&&(e="0"+e),t+=r>12?(r-=12)+":"+e+" PM":r+":"+e+" AM"}function formatDate(){let t="",n=new Date,r=String(n.getDate()).padStart(2,"0");return t+=String(n.getMonth()+1).padStart(2,"0")+"/"+r+"/"+n.getFullYear()}function getPi(){return 3.141592654}function randomArbitrary(t,n){return Math.random()*(n-t)+t}